import React from 'react';
import { useState } from 'react';
import Link from 'next/link';
import Router from 'next/router';
import NProgress from 'nprogress';
import { APP_NAME } from '../../config';
import { signout, isAuth } from '../../actions/auth';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import Search from './../blog/Search';

const Uheader = (props) => {
  return (
      <Nav style={{color:'white', backgroundColor:'#001f24'}} >
        <NavItem>
          <NavLink href="#">Notícias & Mídia</NavLink>
        </NavItem>
        <Nav>
        <NavItem>
          <NavLink href="#">contato@dental04.com</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Seg-Sáb: 09h-18h</NavLink>
        </NavItem>
        <NavItem>
          <NavLink disabled href="#">PT-BR</NavLink>
        </NavItem>     

        </Nav>
          
        {!isAuth() && (
              <React.Fragment>
                <NavItem>
                  <Link href="/signin">
                    <NavLink>Entrar</NavLink>
                  </Link>
                </NavItem>
            
                <NavItem>
                  <Link href="/signup">
                    <NavLink>Cadastrar</NavLink>
                  </Link>
                </NavItem>
              </React.Fragment>
            )}

            {isAuth() && isAuth().role === 0 && (
              <NavItem>
                <Link href="/user">
                  <NavLink>{`${isAuth().name}'s Dashboard`}</NavLink>
                </Link>
              </NavItem>
            )}

            {isAuth() && isAuth().role === 1 && (
              <NavItem>
                <Link href="/admin">
                  <NavLink>{`${isAuth().name}'s Dashboard`}</NavLink>
                </Link>
              </NavItem>
            )}

            {isAuth() && (
              <NavItem>
                <NavLink style={{ cursor: 'pointer' }} onClick={() => signout(() => Router.replace(`/signin`))}>
                  Signout
                </NavLink>
              </NavItem>
            )}
      </Nav>
  );
}

export default Uheader;
